    false,nt"url": null,nt"notes": "This narrative report for Des Lacs National
    Wildlife Refuge, Lostwood National Wildlife Refuge, Lake Ilo National Wildlife Refuge,
    and Easement Refuges - District IV & IVa outlines Refuge accomplishments from September
    through December of 1958. The report begins by summarizing the weather conditions,
    habitat conditions, water conditions, and food and cover during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    rodents, raptors, fish, reptiles, and disease- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, vegetation control,
    and wildfires. Resource management is outlined; topics include grazing, haying,
    and fur harvesting. A progress report on field investigations and applied research
    is also provided. The public relations section of the report describes recreational
    uses, Refuge visitors, Refuge participation, and violations. Items of interest and
    N-R forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
